      compare:{fish_1_ID:"",fish_2_id:""},
    }
  }

  componentDidMount(){
    fetch('https://acnhapi.com/v1a/fish').then(resp=>resp.json).then(json=>this.setState({allfishes:json}));
  }
  render(){return (<p></p>)};
}



export default App;
